import React from "react";

interface Pos {
  x: number;
  y: number;
}

export const createMap = (content: string[]) => {
  const mountain: Pos[] = [];
  const treasure: Pos[] = [];
  const map: string[] = [];

  content.map((c) => {
    const lineSorted = c.split(" ").join("").split("-");

    if (lineSorted.length > 4) {
      alert("error map");
    }
    switch (lineSorted[0]) {
      case "M":
        break;
      case "T":
        break;
      case "M":
        break;
    }

    console.log(lineSorted);
  });
  return [];
};
